import React from 'react'
import styled,{ css } from 'styled-components/macro'

const HeroSection = styled.section`
    height: 100vh;
    max-height:1100px;
    position: relative;
    overflow:hidden;
`
const HeroWrapper = styled.section`
width:100%;
height:300px;
display:flex;
justify-content:center;
align-items:center;
overflow:hidden;
position:relative;
`
function SlideShow() {
    return (
        <HeroSection>
            <HeroWrapper/>
            <h1></h1>
        </HeroSection>
    )
}

export default SlideShow
